During more than 15 years of work, the "Michaelis Moderno Dicionário da Língua Portuguesa" was completely reviewed, updated and expanded by Editora Melhoramentos, and in 2015 it was named "Michaelis Dicionário Brasileiro da Língua Portuguesa".

And now, celebrating 10 years of success in the App Store, the "Michaelis Dicionário Brasileiro da Língua Portuguesa" app was updated and expanded by A&H Software, including a new user interface, more responsive, fluid, modern and attractive. It's been 10 years of work to get you the most complete and updated dictionary of the Portuguese language spoken in Brazil, now exclusively in digital format.

Made with scientific and lexicographical rigor, the "Michaelis Dicionário Brasileiro da Língua Portuguesa" contains more than 350,000 definitions and is updated with terms created due to the development of science and technology, and new words used in the many communication medias, including regionalisms, colloquialisms and slang.

The contents of the entire dictionary follows the Portuguese Language Orthographic Vocabulary (VOLP, 5th edition, March 2009), respecting the changes introduced by the Portuguese Language Orthographic Agreement of 1990.

The complete contents of the dictionary are available and no Internet connection is required.

These are the main features of the "Michaelis Dicionário Brasileiro da Língua Portuguesa":

• complete contents without requiring Internet connection;
• more than 167,000 words and 350,000 definitions;
• more than 47,000 examples and accreditations; more than 27,000 expressions;
• syllable division of the entries;
• references to more than 100 areas of knowledge;
• part of speech and government of verbs;
• etymology of the words, detailing its origin and structure;
• plurals, feminines, irregular augmentatives and diminutives;
• accreditations, idiomatic expressions and slang;
• complete conjugation of all verbs in the dictionary;
• references to synonyms and variants;
• extra texts:
  – rules of syllabic division;
  – usage of crasis, punctuation and capitalization;
  – forms of address, collectives, and verbs;
  – new Portuguese orthography;
• definition lookup from other apps;
• recognition of more than 1,250,000 verb conjugations;
• recognition of plurals, feminines, superlatives, augmentatives and diminutives;
• smart query, including orthoepy, typos and phonetic approximation;
• query by beginning, ending, or middle of entry or by definition of the entry;
• option to configure the colors of information displayed;
• notes, bookmarks and query history;
• word of the day, for learning or just for your curiosity;
• option to save/restore query history and bookmarks from/to iCloud;
• dark mode support, even on pre-iOS 13 devices;
• full support to iPad's splitview and slideover modes;

"Fishing Knots" - is a program for your mobile device, showing how to tie knots.

Among the many knots fisherman should select and use the right one. In each case - his own. How the knot weakens the fishing line? Which knots to use for thin fishing lines, and which - for thick? Which knots can be knit on multifilament fishing line?

The encyclopedia contains different type of knots for: binding of two fishing lines; tying leads; attach large and small hooks, baits, lures, swivels; connection fishing lines and the binding cord; tie a boat and etc.; 

For each knot, tying methods is described in detail. Also description of each knot contains step-by-step guide "How to tie" with illustrations.

Describes in detail the properties of knots. The estimation of the strength reduction for each knot. For each knot provides recommendations for types of fishing lines.

The application can also work without the Internet, all the nodes are loaded during installation.

Selected knots are simple and clear three-dimensional scheme - this is the app "Fishing knots".

Here are a few reasons to install into your device "Fishing Knots":
 - The maximum number of knotes used by fishermen;
 - Graphics extensively tested for intelligibility;
 - The application can run without an Internet connection;
 - Easy to use interface - this is not a website page with a bunch of useless information at the edges;
 - Knots are clearly defined by categories;
 - Each record contain relative knot strength - the breaking strength of a knotted rope in proportion to the breaking strength of the rope without the knot;
 - It is always being updated, refined and increasing.

A Precept is a general rule, tenet or doctrine intended to regulate behaviour or thought.

The Precept Bible is based on the understanding of the scripture in Isaiah 28:9-10 where it clearly states how scriptures will be taught in the last days. The children of the promise would have forgotten their heritage and identity and all the history that they ought to have known.

They would now require some extensive hand-holding as they are taken from passage to passage, and the understanding of each line of scripture is ellucidated and taught to them precept by precept.

If you want to understand the bible, you will need to be guided by the precepts, which are the keys to unlocking the meanings and intents of its passages in context. Let scripture interpret scripture.

START LEARNING PRECEPTS NOW!
- Start by reading the verses and passages related to each precept;
- Get the understanding of the precept by reading the cross-linked verses;
- You begin to see the consistency in scripture when you realise that certain words and phrases maintain specific meaning in all the verses they appear in;
- Connect the dots and you begin to see the bigger picture of what the bible is really revealing.

